Приложение, которое работает за Вас. Станьте ближе к своим клиентам!

Приложение создано для профессионального использования косметологами. Взаимодействует с клиентами, анализирует события, зарабатывает деньги. Основные задачи – хранение клиентской базы и управление ею, организация и контроль записи пациентов, учет выполненных/назначенных процедур, прайсы всех поставщиков препаратов, протоколы процедур, система различных напоминаний, позволяющих удерживать клиентов и многое другое. 

В приложении присутствует Академия, бесплатно обучающая косметологов основам мАркетинга, ведению аккаунта Инстаграм и отдельный мини-курс по инъекционным методикам. Указанные специалисты всегда на связи, и у любого из них можно проконсультироваться по интересующим вопросам.

Для удобства пользователей имеется собственный чат поддержки. Боковое меню имеет раздел «вопросы и ответы», где подробно описаны функции приложения и выложены инструкции по пользованию.

Приложение все данные хранит на облачном хранилище. Это позволяет освободить память телефона и обеспечить абсолютную конфиденциальность информации. Информацию о клиентах невозможно взломать или скопировать. Доступ к ней имеет только косметолог-собственник аккаунта. Администраторы приложения также не имеют доступа к аккаунтам, так это запрещено правилами пользования облачным сервисом. В случае утери телефона доступ к аккаунту восстанавливается в течение 1 минуты через логин и пароль. 
Подробнее о возможностях приложения:
- хранение и упорядочение данных о клиентах со всеми ранее проведенными процедурами и использованными препаратами, протоколами и фотографиями клиента до процедуры/после, заметки;
-  прайсы всех компаний, торгующих препаратами (Аллерган, Мартинекс, Флосаль и т.д.). Автоматическое формирование прайса на услуги косметолога и рассылка клиентам;
- функция записи на процедуры с возможностью рассылки напоминаний клиентам о записи; 
- учет долгов/депозитов у пациентов и косметолога перед дистрибьюторами с напоминанием о просроченных долгах;
- наличие на складе препаратов с контролем срока годности.;
- функция автоматического напоминания клиенту и доктору о важном событии;
- автоматическое напоминание о докоррекции (например, через 3 недели после инъекции ботулотоксина);
- контроль клиентов (в случае, если клиент не обращался какое-то время, косметолог получит уведомление типа «Анна Каренина не была у Вас 2 месяца»);
- напоминания о наличии просроченных обязательств;
- подсказки о противопоказаниях в назначении процедуры согласно анамнезу;
- новости сферы бьюти-индустрии: акции, новые препараты, и проч.;
- все данные можно заполнять голосом;
- синхронизация приложения с телефонной книгой
и много других функций, превращающих приложение в незаменимого помощника косметолога.
Функционал постоянно наращивается в соответствии с пожеланиями пользователей. Для этого достаточно свои пожелания написать в службу поддержки.
